import { Box, styled } from "@mui/material";
import { navData } from "../../constants data/data";

const component = styled(Box)`
`

const NavBar = () => {
  return (
    <Box>
      {navData.map((data) => (
        <Box>
          <img src={data.url} alt="nav" />
          <p>data.text</p>
        </Box>
      ))}
    </Box>
  );
};
export default NavBar;
